import { useEffect } from "react";

function App() {
  useEffect(() => {
    const key = "AIzaSyBEIqK7j9rLo7FHM4Fdl41EITEsGLHFx9E",
      book = "Harry Poter";
    fetch(
      `https://www.googleapis.com/books/v1/volumes?q=${book}&key=${key}&maxResults=40`
    ).then((res) => {
      res.json().then((mess) => {
        mess.items.forEach((elem)=>{
          if (elem.saleInfo.saleability!="NOT_FOR_SALE") console.log(elem);
        })
      });
    });
  }, []);
  return <p>hello world</p>;
}
export default App;

